  export function addMultipleDocsWithAwait(db: Firestore) {
    items.forEach(async (z: Recipe) => {
      const docId = `${z.creator}_${z.name}`;
      const docRef = doc(db, "Recipes", docId);
      await setDoc(docRef, {
        creator: z.creator,
        id: z.id,
        name: z.name,
        ingredients: z.ingredients,
        rating: z.rating,
        comments: z.comments,
        picture: z.picture,
      });
    });
  }